Ext.data.JsonP['Dashboard_4.10.1_Release_Note']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>Dashboard 4.10.1  - 14 February 2017</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n        <div class=\"header\"/>\n\n        <div id=\"src-49156325\" class=\"content\">\n                        <h1>Dashboard 4.10.1  - 14 February 2017</h1>\n    <p>Dashboard 4.10.1 is a patch release, which includes one improvement and two bug fixes.    </p>\n    <div class=\"section section-2 \" id=\"src-49156325_Dashboard4.10.1ReleaseNote-Improvements\">\n        <h2 class=\"heading \"><span>Improvements</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Dashboard provides a better validation response if user attempts to change email address to an existing one    </p>\n</li></ul>    </div>\n    <div class=\"section section-2 \" id=\"src-49156325_Dashboard4.10.1ReleaseNote-Fixedissues\">\n        <h2 class=\"heading \"><span>Fixed issues</span></h2>\n<ul class=\" \"><li class=\" \">    <p>Fixed issue where child organizations were not inheriting the parent organization&apos;s seat limits, purchase periods dates, and entitlements    </p>\n</li><li class=\" \">    <p>Fixed issue on App &gt; Analytics &gt; Events view where data may not be displayed properly when selecting a specific app Version    </p>\n</li></ul>    </div>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=49156325\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"Dashboard 4.10.1 Release Note"});